import React from 'react';
import { observer } from 'mobx-react';
import cx from 'classnames';
import AttributeValueItem from './AttributeValueItem';
import ShapeIcon from '../sidebar/ShapeIcon';
import HighlightHelper from '../../../common/latex/HighlightHelper';
import Formula from '../../../common/latex/Formula';
import Instance from '../../model/Instance';
import InstanceItem from '../../model/InstanceItem';
import store from '../../store/RootStore';
import i18n from '../../locales';
import { parseFields } from '../../utils';
import { LabelStyle, LabelFormat, LabelItem } from '../../types';
import FrameData from '../../model/FrameData';

interface ShapeLabelProps {
  instance: Instance;
  instanceItem: InstanceItem;
  frameData: FrameData;
  centered: boolean;
  x: number;
  y: number;
  visible: boolean;
}

const ShapeLabel = observer(({ instance, instanceItem, frameData, centered, x, y, visible }: ShapeLabelProps) => {
  const { labelStyle, labelFormat, labelItems } = store.config;

  const renderInstanceAttributes = () => {
    const showLabel = labelItems.includes(LabelItem.ATTRIBUTE_KEYS);
    const showValue = labelItems.includes(LabelItem.ATTRIBUTE_VALUES);
    // no config
    if (!showLabel && !showValue) {
      return null;
    }
    const { attributes } = instance;
    // no attributes value
    if (!attributes) {
      return null;
    }
    // no label config
    const { labelConfig: instanceConfig } = instance.categoryRef;
    if (!instanceConfig) {
      return null;
    }
    const instanceFields = parseFields(instanceConfig);
    const attrKeys = Object.keys(attributes || {});
    const fieldKeys = Object.keys(instanceFields);
    const legacyKeys = attrKeys.filter((key) => !fieldKeys.includes(key));
    return [...fieldKeys, ...legacyKeys].map((key) => attrKeys.includes(key) && (
      <AttributeValueItem
        key={key}
        fieldName={key}
        fieldsMap={instanceFields}
        values={attributes}
        showLabel={showLabel}
        showValue={showValue}
      />
    ));
  };

  const renderItemAttributes = () => {
    const showLabel = labelItems.includes(LabelItem.ITEM_ATTRIBUTE_KEYS);
    const showValue = labelItems.includes(LabelItem.ITEM_ATTRIBUTE_VALUES);
    // no config
    if (!showLabel && !showValue) {
      return null;
    }
    const { attributes, isOCR, OCRText, isFormula, formulaText } = frameData;
    // no attributes value
    if (!attributes && isOCR !== true && isFormula !== true) {
      return null;
    }
    const { labelConfig: itemConfig } = instanceItem.categoryItemRef;
    // no label config
    if (isOCR !== true && isFormula !== true && !itemConfig) {
      return null;
    }
    const itemFields = parseFields(itemConfig);
    const attrKeys = Object.keys(attributes || {});
    const fieldKeys = Object.keys(itemFields);
    const legacyKeys = attrKeys.filter((key) => !fieldKeys.includes(key));
    return (
      <>
        {isOCR && (
          <div className="value-item">
            {showLabel && (
              <div className="value-item-label">
                {i18n.translate('OCR_TEXT_LABEL')}
                {showValue && ':'}
              </div>
            )}
            {showValue && (
              <div className="value-item-value">
                {OCRText}
              </div>
            )}
          </div>
        )}
        {isFormula && !isOCR && showValue && (
          <>
            <div className="value-item">
              <div className="value-item-value">
                <HighlightHelper
                  text={formulaText}
                  style={{ wordBreak: 'break-word' }}
                />
              </div>
            </div>
            <Formula text={formulaText} />
          </>
        )}
        {[...fieldKeys, ...legacyKeys].map((key) => attrKeys.includes(key) && (
          <AttributeValueItem
            key={key}
            fieldName={key}
            fieldsMap={itemFields}
            values={attributes}
            showLabel={showLabel}
            showValue={showValue}
          />
        ))}
      </>
    );
  };

  if (labelItems.length <= 0) {
    // no label config
    return null;
  }
  return (
    <div
      key={instanceItem.id}
      id={`label-item-${instanceItem.id}`}
      className={cx('label-item', {
        centered,
        transparent: labelStyle === LabelStyle.TRANSPARENT,
        compressed: labelFormat === LabelFormat.COMPRESSED,
      })}
      style={{ left: x, top: y, visibility: visible ? 'visible' : 'hidden' }}
    >
      <div className="label-title">
        {labelItems.includes(LabelItem.TOOL_NAME) && <span><ShapeIcon shapeType={frameData.shapeType} isOCR={frameData.isOCR} isFormula={frameData.isFormula} /></span>}
        {labelItems.includes(LabelItem.CATEGORY) && <span>{instance.categoryRef.displayName}</span>}
        {labelItems.includes(LabelItem.NUMBER) && <span>{`${instance.number}`}</span>}
        {!instance.isSingle && labelItems.includes(LabelItem.ITEM_NAME) && <span>{instanceItem.name}</span>}
        {!instance.isSingle && !instanceItem.isSingle && labelItems.includes(LabelItem.ITEM_NUMBER) && <span>{`${instanceItem.number}`}</span>}
      </div>
      <div className="label-attributes">
        {renderInstanceAttributes()}
        {renderItemAttributes()}
      </div>
    </div>
  );
});

export default ShapeLabel;
